# ‰º∞Ë®à slope (B_1)
estimate_B_1 = sum((linear_data_X - mean_X) * (linear_data_Y - mean_Y)) / sum(np.square(linear_data_X - mean_X))
# ‰º∞Ë®à intercept (B_0)
estimate_B_0 = mean_Y - estimate_B_1 * mean_X

