# fit ÂÆåÂæåÔºå‰ª£Ë°®ÁõÆÂâçÂ∑≤ÊâæÂà∞‰∏ÄÁµÑ(‰º∞Ë®à)ÂèÉÊï∏ÔºåÊ™¢Êü•Ëá™Â∑±ÂØ´ÂÖ¨Âºè‰º∞Ë®àËàáÂ•ó‰ª∂‰º∞Ë®àÔºåÊúâ‰∏ÄÊ®£ÂóéÔºü
# .coef_ & .intercept_ ÊòØÂõ∫ÂÆöÁî®Ê≥ïÊü•Áúã‰øÇÊï∏
print(f'estimated slope B^_1: {lr_model.coef_}')
