"""ÂæóÂà∞ÂèÉÊï∏ÂæåÂèØÂÆöÁæ© linear regression ÊñπÁ®ãÂºè:

$ \hat{y} = \hat{\beta_0} + \hat{\beta_1} * x $
"""

# ÂèØË¶ñÁÇ∫È†êÊ∏¨ÂïÜÂìÅÈä∑ÂîÆÈ°çÁöÑ model
# x ÁÇ∫Ëä±Âú®ÈõªË¶ñÂª£Âëä‰∏äÁöÑÁ∂ìË≤ªÔºåy^ ÁÇ∫È†êÊ∏¨ÁöÑÂïÜÂìÅÈä∑ÂîÆÈ°ç
def lr_func(x):
    return estimate_B_0 + estimate_B_1 * x  # numpy.ndarray

# ÂëºÂè´ model: lr_funcÔºåËº∏ÂÖ•‰∏ÄÂÄã xÔºåÂæóÂà∞‰∏ÄÂÄã y
x = 500000
pred_y = lr_func(x)
print(pred_y)
print(f'Âª£ÂëäÊàêÊú¨: {x} ÂÖÉÔºåÈ†êÊ∏¨ÂÖ∂Èä∑ÂîÆÈ°ç: {np.round(pred_y)} ÂÖÉ')  # np.round() ÂõõÊç®‰∫îÂÖ• ÂèñÊï¥Êï∏

# ÂëºÂè´ model: lr_funcÔºåËº∏ÂÖ•‰∏ÄÁµÑ xÔºåÂæóÂà∞‰∏ÄÁµÑ y
# ÂÅáË®≠ÊúâÂ§öÂÄãÂïÜÂìÅÁöÑÂª£ÂëäÊàêÊú¨(x)ÔºåÊàëÊÉ≥Áü•ÈÅìÊØèÂÄãÂïÜÂìÅÂàÜÂà•È†êÊ∏¨ÁöÑÈä∑ÂîÆÈ°çÊòØÂ§öÂ∞ëÔºü
# Â∞áÂáΩÂºè lr_func ÊáâÁî®Âà∞‰∏ÄÁµÑËº∏ÂÖ•‰∏≠ÁöÑÊØèÂÄãÂÖÉÁ¥†
X = [10000, 25000, 4000, 2000000]
