print(np.round(pred_Y))

# np.round(pead_Y, decimals=n) Â∞ç array ‰∏≠ÊØèÂÄãÂÖÉÁ¥†ÂõõÊç®‰∫îÂÖ•Âà∞Â∞èÊï∏ÂæåÁ¨¨n‰Ωç
print(np.round(pred_Y, decimals= 2))

# ‰ΩøÁî®int() ÁÑ°Ê¢ù‰ª∂Êç®ÂéªÂ∞èÊï∏ÈÉ®ÂàÜ
pred_Y_int = np.array([int(x) for x in pred_Y])
