# for-loop Ëß£Èáã‰ª•‰∏ä‰ΩúÊ≥ï
pead_Y = []
for i in range(len(X)):
    pead_Y.append(np.round(lr_func(X[i])))

print(pead_Y)

# Ë©¶Ë©¶ÁúãÁî®ÂâõÂâõ sklearn Â•ó‰ª∂ fit ÂÆåÊàêÁöÑ lr_model Â∞ç X ÈÄ≤Ë°åÈ†êÊ∏¨
lr_model.predict(X)

