logistic_model.predict_proba(logistic_data_X)[:,1]

"""$$
\sigma(z) = \frac{1}{1 + e^{-z}} = \frac{1}{1 + e^{-(b_0 + b_1 x)}} = \frac{e^{(b_0 + b_1 x)}}{e^{(b_0 + b_1 x)} + 1}
$$
where
$$
z = b_0 + b_1 x
$$
"""

estimate_B0 = logistic_model.intercept_
estimate_B1 = logistic_model.coef_
def logistic_func(x):
    z = estimate_B0 + estimate_B1 * x
    y = np.exp(z) / 1+ np.exp(z)
    return y

print(logistic_func(logistic_data_X[0]))
logistic_func(logistic_data_X[0]) > 0.5

print(logistic_func(logistic_data_X[1]))
logistic_func(logistic_data_X[1]) > 0.5

